#!/usr/bin/env pwsh
<#
.SYNOPSIS
PMC TUI Portable Package - Part 1 of 2

.DESCRIPTION
Self-extracting PowerShell package for PMC TUI.
This script combines data from both parts and extracts to the current directory.

.PARAMETER DestinationPath
Where to extract (default: ./pmc-tui)

.EXAMPLE
.\pmcp1.ps1
.\pmcp1.ps1 -DestinationPath C:\pmc-test
#>

param(
    [string]$DestinationPath = "./pmc-tui"
)

Set-StrictMode -Version Latest
$ErrorActionPreference = 'Stop'

Write-Host "=== PMC TUI Package Extractor ===" -ForegroundColor Cyan
Write-Host ""

# Embedded data - Part 1
$part1Data = @'

'@

# Load Part 2
Write-Host "Loading pmcp2.ps1..." -ForegroundColor Yellow
if (-not (Test-Path "$PSScriptRoot/pmcp2.ps1")) {
    Write-Error "pmcp2.ps1 not found in same directory as pmcp1.ps1"
    Write-Error "Both files must be in the same folder."
    exit 1
}

. "$PSScriptRoot/pmcp2.ps1"

if (-not $global:PmcPackagePart2) {
    Write-Error "Failed to load package data from pmcp2.ps1"
    exit 1
}

Write-Host "  Part 2 loaded successfully" -ForegroundColor Green

# Combine parts
Write-Host "Combining package data..." -ForegroundColor Yellow
$completeBase64 = $part1Data + $global:PmcPackagePart2

# Decode Base64
Write-Host "Decoding package..." -ForegroundColor Yellow
try {
    $zipBytes = [System.Convert]::FromBase64String($completeBase64)
    $sizeMB = [math]::Round($zipBytes.Length / 1MB, 2)
    Write-Host "  Decoded $sizeMB MB" -ForegroundColor Green
} catch {
    Write-Error "Failed to decode package data: $_"
    exit 1
}

# Write to temp ZIP
$tempZip = [System.IO.Path]::GetTempFileName() + ".zip"
Write-Host "Creating temporary ZIP..." -ForegroundColor Yellow
[System.IO.File]::WriteAllBytes($tempZip, $zipBytes)

# Extract
Write-Host "Extracting to: $DestinationPath" -ForegroundColor Yellow

if (Test-Path $DestinationPath) {
    $response = Read-Host "Destination exists. Overwrite? (y/n)"
    if ($response -ne 'y') {
        Write-Host "Extraction cancelled" -ForegroundColor Red
        Remove-Item $tempZip -Force
        exit 0
    }
    Remove-Item -Path $DestinationPath -Recurse -Force
}

New-Item -ItemType Directory -Path $DestinationPath -Force | Out-Null

Add-Type -AssemblyName System.IO.Compression.FileSystem
[System.IO.Compression.ZipFile]::ExtractToDirectory($tempZip, $DestinationPath)

# Cleanup
Remove-Item $tempZip -Force
$global:PmcPackagePart2 = $null

Write-Host "  Extraction complete" -ForegroundColor Green
Write-Host ""
Write-Host "=== NEXT STEPS ===" -ForegroundColor Cyan
Write-Host "1. Navigate to the TUI directory:"
Write-Host "   cd $DestinationPath/module/Pmc.Strict/consoleui" -ForegroundColor Yellow
Write-Host ""
Write-Host "2. Start the TUI:"
Write-Host "   .\Start-PmcTUI.ps1" -ForegroundColor Yellow
Write-Host ""
